import React, { Component } from "react";

class App extends Component {
  render() {
    return (
      <div className="container con">
        <div className="row weather">
          <div className="col-sm-2 bor">
            <i className="wi wi-day-sunny size" />
          </div>
          <div className="col-sm-2 bor justify-content-center">
            <i className="wi wi-day-cloudy size" />
          </div>
          <div className="col-sm-2 bor">
            <i className="wi wi-day-cloudy size" />
          </div>
          <div className="col-sm-2 bor">
            <i className="wi wi-day-cloudy size" />
          </div>
          <div className="col-sm-2 bor">
            <i className="wi wi-day-cloudy size" />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
